:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  WILLIAMS, Edward Marsh and DAVIS, Jane
  WILLIAMS, Thomas Sydney and WILLIAMS, Agnes Lydia
  IWILLIAMS, Rachel Millicent and REED, Alfred Vincent Standish
  04> REED, Janet Millicent
  b 07.01.1927
  Janet b. at Napier. Address: 29/233 Guppy Road, Taradale.
  Janet was in charge of catering at Princess Alexandra Hospital for 14 1/2 years until her retirement in
  1989. She also cared for her mother in her old age.
  03> WILLIAMS, Oswald Temple (Gos) m on 04.01.1916 to WOOD, Violet Lethridge
  b 13.02.1889 d 24.11.1967
  b 19.09.1882 d 19.03.1966
  Oswald b. at Pakaraka, Bay of Islands. Violet b. in Queensland where her family
  owned "Calliungal" cattle station near Rockhampton.
  Oswald attended Huntley School and Wanganui Collegiate School and completed two
  years of a medical degree at Cambridge. On his return to New Zealand he took over
  a portion of his father's "Pakihiroa" property in 1916. After their marriage,
  Oswald and Violet lived and farmed for 19 years at "Raparapaririki" station (known
  as "The Rip" station), Ruatoria. This was part of the original "Pakihiroa" property purchased as virgin
  bush land from the Maoris in 1896 by Thomas Sydney Williams, Oswald's father. They established
  "Titiraukena" in 1936 as a homestead property and lived there for 25 years. They retired to Wainui Beach in
  1960. Oswald was a member of the Waiapu County Council from 1926 to 1953.
  01> WILLIAMS, Anthony John m on 17.08.1946 to WILLIAMS, Margaret Octavia
  Oswald
  b 31.03.1918
  b 31.05.1920
  Anthony b. at Gisborne and m. at Te Puia Springs. Margaret, d/o Arthur Merritt Beale and Emma Reremoana
  Brown and adopted by Arnold Beetham Williams. Refer also Margaret's entry in this Family Tree. Address:
  RD 2, Ngatapa, Gisborne.
  Anthony was educated at Wanganui Collegiate School (1st XV, Prefect). During WW2 he served in 14 Lt AA
  Regt in the Middle East from 1941 until he returned wounded in Jan 1943. After their marriage Anthony
  and Margaret lived on "The Rip" station where they farmed until 1969 when the property was sold to the
  Crown for reafforestation on account of severe erosion. The family re-established at Wharekopae in the
  Gisborne district on "Mutuera" station. Anthony and Margaret have lived at "Curragundi", Ngatapa since
  1969. Anthony was a director of Williams and Kettle for 12 years.
  01> WILLIAMS, Erica m on 28.02.1969 to HOLDEN, Edward Bruce
  b 03.06.1947
  b 18.02.1945
  Erica b. and m. at Gisborne. Divorced. Bruce, s/o Ronald and Lynley Holden. Address: 85 Atkinson
  Road, Titirangi, Auckland.
  Erica was educated at Queenswood School and Woodford House. She is an artist, living between
  Auckland and Gisborne.
  01> HOLDEN, Anthony Bruce
  b 21.09.1970
  Anthony was educated at Rathkeale College and Gisborne Boys' High School then went shepherding
  on the East Coast and in Australia. He is now stock agent with Wright Stephensons for the East
  Coast.
  02> HOLDEN, Ronald Ben
  b 15.07.1972
  Ben was educated at Rathkeale College and Gisborne Boys' High School and is now living in
  Shrewsbury, Wales, and working as a car salesman.
